import './projects.css'




function proj() {

    return (
        <world className="plan" >
            <ttl className="title">
                sales management database system 
            </ttl>
            <steps className="steps">
                <li>
                    install hardware
                </li>
                <li>
                    install operating system
                </li>
                <li>
                    install database
                </li>
            </steps>
            
            
        </world>

    );

}
export default proj;
